package com.company.bazar.model;import jakarta.persistence.Column;import jakarta.persistence.Entity;import jakarta.persistence.GeneratedValue;import jakarta.persistence.GenerationType;import jakarta.persistence.Id;import lombok.Getter;import lombok.Setter;import org.springframework.context.annotation.EnableMBeanExport;@Getter@Setter@Entitypublic class Client {    @Id    @GeneratedValue(strategy = GenerationType.SEQUENCE)    private Long idClient ;    private String nameClient ;    private  String lastnameClient;    private String dni;    public Client() {    }    public Client(Long idClient, String nameClient, String lastnameClient, String dni) {        this.idClient = idClient;        this.nameClient = nameClient;        this.lastnameClient = lastnameClient;        this.dni = dni;    }}